import React from 'react';
import { Link } from 'react-router-dom';
import { Car } from '../Atoms/Carmodel';
import backgroundImage from '../../background.jpg';

interface CarPageProps {
  carData: Car[];
}

const CarPage: React.FC<CarPageProps> = ({ carData }) => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        minHeight: '100vh',
        background: `url(${backgroundImage})`, // Assuming backgroundImage is defined
        backgroundSize: 'cover',
      }}
    >
      <div
        style={{
          backgroundColor: 'rgba(255, 255, 255, 0.1)',
          padding: '20px',
          borderRadius: '10px',
          maxWidth: '800px',
          width: '100%',
        }}
      >
        <div>
          {carData.map((car) => (
            <div key={car.id} style={{ marginBottom: '20px' }}>
              <Link to={`/cars/${car.id}`} style={{ textDecoration: 'none', color: 'white' }}>
                <img
                  src={car.link}
                  alt={`${car.brand} ${car.model}`}
                  style={{ width: '100%', borderRadius: '10px' }}
                />
                <p style={{ fontSize: '24px', fontWeight: 'bold', marginTop: '10px' }}>
                  {car.brand} {car.model}
                </p>
              </Link>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default CarPage;
